// import react testing library
 import { render, screen, fireEvent, cleanup } from '@testing-library/react';
 import VidMain from './vidMain';
 
 // increase timeout duration of test
 jest.setTimeout(100000)
 
 //mock service worker 
 import {rest} from "msw";
 import {setupServer} from "msw/node"
 
  // predetermined base64 of an image
 let imageData = ""
 
 let imageData2 = ""
 
 let imageDataArray = [imageData, imageData2]
 
 //mocking  a server repsonse for a particular URL (post req)
 let serverResponse =rest.post("http://127.0.0.1:5000/vid", (req, res, ctx)=>{
     return res(
         ctx.status(200),
         ctx.json(
             {      
                 result:imageDataArray,
                 
                 
             }
         )
     )
 })
         
//   ... are handlers 
 const server = new setupServer(...[serverResponse])
 // response that the server will handle for the particular url
 beforeAll(() => server.listen())
 afterEach(() => server.resetHandlers())
 afterAll(() => server.close())
 
 
 
// test the loading of the page
 test('renders learn react link', () => {
   render(<VidMain />);
 });
 
 //test the text bocx inputs 
 let testInputTextBox = (formValue, alertValue, start_button) =>{
     
    // click the button
     // assume file has been uploaded
     fireEvent.click(start_button)
 
     expect(alertValue).toBeVisible();
     expect(alertValue).toHaveTextContent("This input cannot be left blank.")
     
 
     // add non-integer/float value into it
     fireEvent.change(formValue, {target: {value: "alphabets"}})
 
     // expect the input field to have the current value
     expect(formValue.value).toBe("alphabets")
 
     // click start button
     fireEvent.click(start_button)
    
     // test f alert will appear with wrong input
     expect(alertValue).toBeVisible();
     expect(alertValue).toHaveTextContent("Input can only be integers/decimals.")
 
     // add non-integer/float value into it
     fireEvent.change(formValue, {target: {value: "12"}})
 
     // expect the input field to have the current value
     expect(formValue.value).toBe("12")
 
     // click start button
     fireEvent.click(start_button)
 
     expect(alertValue).not.toBeVisible();
 
     // add non-integer/float value into it
     fireEvent.change(formValue, {target: {value: "12.34"}})
 
     // expect the input field to have the current value
     expect(formValue.value).toBe("12.34")
 
     // click start button
     fireEvent.click(start_button)
 
     expect(alertValue).not.toBeVisible();
 }
 
 //test the dropdown components 
 let testDropDown = (formValue, alertValueIn, start_button, optionToBeTested, formValId) =>{
   
    // click the button
    // assume file has been uploaded
    fireEvent.click(start_button)

    let alertValue = screen.getByTestId(alertValueIn)
    // test if alert will appear if dropdown empty
    expect(alertValue).toBeVisible();
    expect(alertValue).toHaveTextContent("This input cannot be left blank.")
    
    fireEvent.click(formValue)

    // get the option currently displayed on screen 
    let formValueOption = screen.getAllByTestId(optionToBeTested + "_options")
    let indexToUse
    if(formValueOption.length > 1){
        for(let index = 0;index < formValueOption.length;index++){
            if(formValueOption[index].display != "none"){
                indexToUse = index
            }
        }
    }
    else{
        indexToUse = 0
    }
    

    // choose a dropdown Value
    fireEvent.click(formValueOption[indexToUse])

    // expect the dropdown field to have the current value
    formValue = screen.getByTestId(formValId)
    expect(formValue.innerHTML).toBe(optionToBeTested)

    // click go button
    fireEvent.click(start_button)
    //  alert should not appear if input correct 
    expect(alertValue).not.toBeVisible();
}
 

