//  Main testing to run all dropdowns and inputs and mock server reply
 test("test user input form",async() =>{
     // function collection to test different options
     let optionTestingFunctionCollection = [checkOption1, checkOption2, checkOption3, checkOption4, checkOption5]
 
     let optionTextCollection = ["Uniform Sampling + Histogram Comparison","Absolute Histogram Difference", "Absolute Frame Difference (LUV)", "K-Means Clustering", "Dynamic Clustering"]
     
     for (let index = 0;index < optionTestingFunctionCollection.length;index++){
         render(<VidMain />);
 
        // main dropdown
         let mainDropDown = screen.getByTestId("mainDropDown")
         fireEvent.click(mainDropDown)
 
         let mainDropDownOption = screen.getByTestId(optionTextCollection[index]+"_options")
         fireEvent.click(mainDropDownOption)
 
         // click start button
         const start_button = screen.getByTestId("extract_button")
         fireEvent.click(start_button)
 
         // get file upload input alert
         let file_upload_input_alert = screen.getByTestId("no_file_selected_alert")
         expect(file_upload_input_alert).toBeVisible();
 
         // select file to upload
         let file = new File(["vidFile"],"test_vids/test_image.jpg", {
             type: "image/jpg"
         })
 
         fireEvent.change(screen.getByTestId("fileToUpload"), {
             target: { files: [file] },
         });
 
         // click button again
         fireEvent.click(start_button)
 
         // expect alert to stay as it is jpg
         expect(file_upload_input_alert).toBeVisible();
 
         // select webm to upload
         file = new File(["vidFile"],"trial.webm", {
             type: "video/webm"
         })
         fireEvent.change(screen.getByTestId("fileToUpload"), {
             target: { files: [file] },
         });
 
         // click button again
         fireEvent.click(start_button)
 
         // expect alert to go away as it is valid video file
         expect(file_upload_input_alert).not.toBeVisible();
 
         
         optionTestingFunctionCollection[index]()  
         
         // expect spinner to be visible
         let spinner_show = screen.getByTestId("processing_spinner")
 
         expect(spinner_show).toBeVisible();
 
 
         // expect image to show after axios mock reply
 
         let image_show = await screen.findAllByTestId("image_id")
 
         expect(image_show[0]).toBeVisible()
 
         // check if image data is accurate
         expect(image_show[0].src).toBe("data:image/jpg;base64," + imageDataArray[0])
 
         expect(image_show[1]).toBeVisible();
 
         // check if image data is accurate
         expect(image_show[1].src).toBe("data:image/jpg;base64," + imageDataArray[1])
 
         cleanup()
     }
 
 });